import React from 'react'
import {useEffect} from 'react'
import axios from "axios"

const List = (props) => {
    // useEffect(() => {
    //     alert("Success");
    // })


    useEffect(() => {
        axios
        .post("/api/test")
        .then((response) =>{
            alert("Success");
            console.log(response.data);

        })
        .catch((error) => {
            alert("Failure");
            console.log(error);

    });
    }, [])

    return (
        <div>
            <h1>
                List!
            </h1>
      {props.ContentList.map((content,idx) => {return <div key={idx}>{content}</div>;
      })}

    </div>
    );
};

export default List;
